uy til e interesante para los nios. Es perfecto para ensear lo que son los objetivos de desarrollo sostenible. Es un excelente vdeo para educacin primaria.\n#ODS\n\nSi te gustan nuestros vdeos, descarga la app de Smile and Learn. Descubrirs miles de actividades entre juegos, cuentos interactivos y vdeos para nios creados por educadores. Nuestro contenido est disponible en ESPAOL, INGLS, PORTUGUS, CATALN, ITALIANO, FRANCS y TURCO.\n\nwww.smileandlearn.com","commandRuns":[{"startIndex":1153,"length":4,"onTap":{"innertubeCommand":{"clickTrackingParams":"CLwCENzXBBgDIhMIjtipq6a4hQMVBmNPBB1V8wiq","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/ods","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUJCgNvZHMQARgB"}}},"loggingDirectives":{"trackingParams":"CLwCENzXBBgDIhMIjtipq6a4hQMVBmNPBB1V8wiq","enableDisplayloggerExperiment":true}}],"styleRuns":[{"startIndex":0,"length":1153,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"},{"startIndex":1153,"length":4,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4282296063},{"key":"USER_INTERFACE_THEME_LIGHT","value":4278607828}]}},"fontFamilyName":"Roboto"},{"startIndex":1157,"length":303,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1153,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":1153,"length":4,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":1157,"length":303,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}}],"trackingParams":"CLoCELovIhMIjtipq6a4hQM
